import React from 'react';
import Grid from '@material-ui/core/Grid';
import Padding from '../components/padding'
import Navigation from '../components/navigation'

export default function Welcome(props){

    return(

        <Grid container justify="center" direction="column" alignItems="center" spacing={5} style={{height: "640px"}}>
            <Grid item xs={12}>
                <h1 style={{color: '#084177'}}>Hit Next to Get Started</h1>
            </Grid>

            <Navigation next="/step1/name" alignself="end" />
      </Grid>

    )

}
